oxy_webhelp_navlinks = {"performance_and_integration-d43829e34041":{"topics":[{"title":"View document accounting transactions","shortdesc":"<p class=\"shortdesc\">In the area that allows viewing the technical documents of         Cleva Life v7, it is now available a new widget that allows viewing the accounting         transactions generated by TAC for the corresponding document.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_172572_en\/code_172572_functional.html","attributes":{"data-id":"code_172572_functional"},"menu":{"hasChildren":false},"tocID":"code_172572_functional-d43829e34059","topics":[]},{"title":"Consumption of events by event date\/time","shortdesc":"<p class=\"shortdesc\">The goal of this feature is to enable TAC to consume and         process the events by their date\/time, thus preventing more recent events from being         consumed before the older ones.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_147077_en\/code_147077_functional.html","attributes":{"data-id":"code_147077_functional"},"menu":{"hasChildren":false},"tocID":"code_147077_functional-d43829e34077","topics":[]},{"title":"Performance enhancement","shortdesc":"<p class=\"shortdesc\">The aim of this feature is to enhance TAC’s performance in         the consumption and processing of the documents\/events generated by the technical areas.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_114979_en\/code_114979_functional.html","attributes":{"data-id":"code_114979_functional"},"menu":{"hasChildren":false},"tocID":"code_114979_functional-d43829e34095","topics":[]},{"title":"Integration with Cleva Accounting","shortdesc":"<p class=\"shortdesc\">The objective of this feature is to enable the integration         between TAC and Cleva Accounting (FAC), thus allowing the accounting transactions produced         by TAC to be entered into FAC automatically.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_98151_en\/code_98151_functional_4.html","attributes":{"data-id":"code_98151_functional"},"menu":{"hasChildren":false},"tocID":"code_98151_functional-d43829e34113","topics":[]},{"title":"Integration with modelling software ","shortdesc":"<p class=\"shortdesc\">The objective of this feature is to equip TAC with the         capacity to process information sourced from the modelling software and to convert this         information into accounting transactions.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_98131_en\/code_98131_functional_2.html","attributes":{"data-id":"code_98131_functional"},"menu":{"hasChildren":false},"tocID":"code_98131_functional-d43829e34131","topics":[]},{"title":"Improved performance of transaction search by tax year\/month","shortdesc":"<p class=\"shortdesc\">The search for transactions by tax year\/month was improved         in version 7.11.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_157721_en\/code_157721_functional.html","attributes":{"data-id":"code_157721_functional"},"menu":{"hasChildren":false},"tocID":"code_157721_functional-d43829e34149","topics":[]},{"title":"Purge of processed\/consumed data","shortdesc":"<p class=\"shortdesc\">There is a new process available to perform the automatic         cleaning of the temporary data from TAC’s database.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_152730_en\/code_152730_functional.html","attributes":{"data-id":"code_152730_functional"},"menu":{"hasChildren":false},"tocID":"code_152730_functional-d43829e34167","topics":[]},{"title":"Performance | Bulk inserts and multi-instance deployment","shortdesc":"<p class=\"shortdesc\">With the goal of improving the TAC's performance when         processing events, the storage of transactions in the database will now be carried out in         bulk.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_158935_en\/code_158935_functional.html","attributes":{"data-id":"code_158935_functional"},"menu":{"hasChildren":false},"tocID":"code_158935_functional-d43829e34185","topics":[]},{"title":"Work with Cost accounting","shortdesc":"<p class=\"shortdesc\">This feature enables TAC to work with Cost         accounting.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_182717_en\/code_182717_functional.html","attributes":{"data-id":"code_182717_functional"},"menu":{"hasChildren":false},"tocID":"code_182717_functional-d43829e34203","topics":[]},{"title":"Work with Cost accounting","shortdesc":"<p class=\"shortdesc\">This feature enables TAC to work with Cost         accounting.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_182717_en\/code_182717_configuration.html","attributes":{"data-id":"code_182717_configuration"},"menu":{"hasChildren":false},"tocID":"code_182717_configuration-d43829e34221","topics":[]}]}};